import React from 'react';

const Dashboard = () => {
  return (
    <div className="flex flex-col items-center justify-center h-full">
      <h2 className="text-2xl font-bold text-blue-700 mb-4">Welcome to Localize Email!</h2>
      <p className="text-gray-600">Start by uploading your HTML email to localize.</p>
    </div>
  );
};

export default Dashboard;
